import{_ as a,c as r,o as l,a3 as o}from"./chunks/framework.DTP3B4Zp.js";const f=JSON.parse('{"title":"HayFrp帮助","description":"","frontmatter":{},"headers":[],"relativePath":"help.md","filePath":"help.md"}'),e={name:"help.md"},t=o('<h1 id="hayfrp帮助" tabindex="-1">HayFrp帮助 <a class="header-anchor" href="#hayfrp帮助" aria-label="Permalink to &quot;HayFrp帮助&quot;">​</a></h1><blockquote><p>此页用于查看您在HayFrp使用上遇到的部分问题的部分解决方式</p><p>如果仍然无法解决请尝试联系我们.</p><p>注：我们无法完全保证您出现的问题是否在我们文档记录内.</p></blockquote><h1 id="介绍hayfrp" tabindex="-1">介绍HayFrp <a class="header-anchor" href="#介绍hayfrp" aria-label="Permalink to &quot;介绍HayFrp&quot;">​</a></h1><h2 id="_1-什么是-hayfrp" tabindex="-1">1. 什么是 HayFrp？ <a class="header-anchor" href="#_1-什么是-hayfrp" aria-label="Permalink to &quot;1. 什么是 HayFrp？&quot;">​</a></h2><p>HayFrp 是一款内网穿透软件，旨在帮助用户将内网资源暴露到公网，实现远程访问。它通过社区捐赠和用户免费使用的方式，构建了一个公益的社区环境。</p><h2 id="_2-她能做什么" tabindex="-1">2. 她能做什么？ <a class="header-anchor" href="#_2-她能做什么" aria-label="Permalink to &quot;2. 她能做什么？&quot;">​</a></h2><p>HayFrp 可以在多种环境中使用，例如：</p><ul><li><strong>MC服务器</strong>：将本地运行的 Minecraft 服务器暴露到公网，让玩家可以从任何地方加入。</li><li><strong>网站调试</strong>：通过内网穿透，在本地开发环境中调试网站，方便查看效果。</li><li><strong>建站</strong>：将本地网站暴露到公网，方便用户访问。</li><li><strong>远程桌面</strong>：通过内网穿透，远程访问和控制本地计算机。</li><li><strong>远程控制</strong>：通过内网穿透，远程控制其他设备。</li><li><strong>更多环境</strong>：适用于各种需要将内网资源暴露到公网的场景。</li></ul><h2 id="_3-使用体验如何" tabindex="-1">3. 使用体验如何？ <a class="header-anchor" href="#_3-使用体验如何" aria-label="Permalink to &quot;3. 使用体验如何？&quot;">​</a></h2><p>您需要自行体验，作为公益的内穿节点提供商，我们无法完全保证用户的体验。您可以查看各平台对我们的体验分析进行一定的了解。</p><p><a href="https://www.bilibili.com/read/cv34257581/?jump_opus=1" target="_blank" rel="noreferrer">查看B站辟谣文章</a></p><h1 id="如何使用-hayfrp" tabindex="-1">如何使用 HayFrp？ <a class="header-anchor" href="#如何使用-hayfrp" aria-label="Permalink to &quot;如何使用 HayFrp？&quot;">​</a></h1><h2 id="_1-注册-hayfrp-账户" tabindex="-1">1. 注册 HayFrp 账户 <a class="header-anchor" href="#_1-注册-hayfrp-账户" aria-label="Permalink to &quot;1. 注册 HayFrp 账户&quot;">​</a></h2><ol><li>访问控制台：<a href="https://console.hayfrp.org" target="_blank" rel="noreferrer">访问源站</a> 或 <a href="https://hay.rcov.top" target="_blank" rel="noreferrer">访问镜像站</a>。</li><li>点击“进入控制台”以进入登录页。</li><li>在登录页中，点击“没有账户？注册！”以跳转至注册页。</li><li>在注册页中，输入用户名、密码、邮箱，点击“发送验证码”。</li><li>打开邮箱软件，找到信件“注册HayFrp账户”，复制里面的验证码，粘贴到输入框中，点击“注册”。</li><li>如果没有问题，您应该可以注册成功并自动跳转到登录页。</li><li>如果没有收到验证码，请在60s后再次点击“重新发送验证码”。</li></ol><h2 id="_2-登录-hayfrp-账户" tabindex="-1">2. 登录 HayFrp 账户 <a class="header-anchor" href="#_2-登录-hayfrp-账户" aria-label="Permalink to &quot;2. 登录 HayFrp 账户&quot;">​</a></h2><ol><li>访问控制台：<a href="https://console.hayfrp.org" target="_blank" rel="noreferrer">访问源站</a> 或 <a href="https://hay.rcov.top" target="_blank" rel="noreferrer">访问镜像站</a>。</li><li>点击“进入控制台”以进入登录页。</li><li>在登录页中，输入用户名、密码，点击“登录”。</li><li>如果没有问题，您应该可以登录成功并自动跳转到控制台。</li></ol><h2 id="_3-使用-hayfrp" tabindex="-1">3. 使用 HayFrp <a class="header-anchor" href="#_3-使用-hayfrp" aria-label="Permalink to &quot;3. 使用 HayFrp&quot;">​</a></h2><ol><li>访问控制台：<a href="https://console.hayfrp.org" target="_blank" rel="noreferrer">访问源站</a> 或 <a href="https://hay.rcov.top" target="_blank" rel="noreferrer">访问镜像站</a>。</li><li>点击“进入控制台”以进入登录页。</li><li>如果已登录，则会自动跳转到控制页。</li><li>在控制台中，点击“隧道”来到隧道页。</li><li>在隧道页中，您可以管理已创建的隧道。</li><li>点击“新建隧道”来到新建隧道页面。</li><li>在新建隧道页面中，选择隧道类型、隧道名称、隧道协议、隧道本地端口、隧道远程端口、所需隧道节点，点击“创建”。</li><li>如果没有问题，您应该可以创建成功并自动跳转到隧道列表。</li><li>在隧道列表中，点击您的隧道，即可显示隧道详情。点击“配置”即可显示隧道配置文件，您可以点击“复制”将隧道配置一键复制。</li><li>到下载页，选择适合您系统和架构的 Frp 客户端，点击“跳转以下载”以下载文件。</li><li>将文件下载后解压，找到“frpc.toml”编辑，将复制的配置文件覆盖进去后保存。</li><li>在终端（Windows11）输入“./frpc.exe -c frpc.toml”。</li><li>在CMD（Windows）输入“frpc.exe -c frpc.toml”。</li><li>在Shell（MacOS/Linux/Unix）输入“./frpc -c frpc.toml”。</li><li>即可启动隧道。</li><li>外网地址在控制台复制即可使用。</li></ol><h2 id="_4-hayfrp-控制台功能介绍" tabindex="-1">4. HayFrp 控制台功能介绍 <a class="header-anchor" href="#_4-hayfrp-控制台功能介绍" aria-label="Permalink to &quot;4. HayFrp 控制台功能介绍&quot;">​</a></h2><ul><li><strong>主页</strong>：查看账户数据概览，HayFrp 数据概览和公告。</li><li><strong>用户</strong>：查看账户数据概览，签到、实名认证、绑定 QQ 机器人、更改 QQ 号头像。</li><li><strong>隧道</strong>：查看已创建的隧道列表，添加新隧道、编辑隧道、删除隧道、强下隧道、启用隧道、禁用隧道、获取隧道状态、获取隧道配置文件、获取 X/S TCP 隧道的参与者配置文件。</li><li><strong>节点</strong>：查看节点的实时负载状态。</li><li><strong>下载</strong>：下载对应您系统和架构的客户端。</li><li><strong>帮助</strong>：获取帮助方式以及 HayFrp 镜像站协议。</li><li><strong>增值</strong>：用兑换码兑换增值服务，包括增加隧道、增加流量。</li><li><strong>联机</strong>：选用联机模板，快速建立新的隧道，分享房间、查看公共房间（正在开发中）。</li><li><strong>登出</strong>：退出您的 HayFrp 账户登录状态。</li><li><strong>关于</strong>：关于本面板。</li><li><strong>设置</strong>：面板的本地化个性设置（正在开发中）。</li></ul><h1 id="一些问题" tabindex="-1">一些问题 <a class="header-anchor" href="#一些问题" aria-label="Permalink to &quot;一些问题&quot;">​</a></h1><h2 id="隧道启动失败" tabindex="-1">隧道启动失败 <a class="header-anchor" href="#隧道启动失败" aria-label="Permalink to &quot;隧道启动失败&quot;">​</a></h2><h3 id="提示-隧道已被禁用" tabindex="-1">提示“隧道已被禁用” <a class="header-anchor" href="#提示-隧道已被禁用" aria-label="Permalink to &quot;提示“隧道已被禁用”&quot;">​</a></h3><p>请到 HayFrp Console 选中对应隧道后单击启用。</p><h3 id="提示-隧道不存在" tabindex="-1">提示“隧道不存在” <a class="header-anchor" href="#提示-隧道不存在" aria-label="Permalink to &quot;提示“隧道不存在”&quot;">​</a></h3><p>请检查您的配置文件是否正确，如果发现非用户问题请提交至 HayFrp 官方。</p><h3 id="报错-节点没有上线权限" tabindex="-1">报错“节点没有上线权限” <a class="header-anchor" href="#报错-节点没有上线权限" aria-label="Permalink to &quot;报错“节点没有上线权限”&quot;">​</a></h3><p>请等待节点在 HayFrp 在线节点列表出现后重试。</p><h3 id="报错-未找到节点" tabindex="-1">报错“未找到节点” <a class="header-anchor" href="#报错-未找到节点" aria-label="Permalink to &quot;报错“未找到节点”&quot;">​</a></h3><p>您正在连接的节点非 HayFrp 官方授权运行，建议您将配置文件提交给 HayFrp 官方鉴定。</p><h3 id="报错-i-o-timeout" tabindex="-1">报错“i/o timeout” <a class="header-anchor" href="#报错-i-o-timeout" aria-label="Permalink to &quot;报错“i/o timeout”&quot;">​</a></h3><p>一般来说是客户端在连接节点时发生超时，也有可能是节点连接到 HayFrp API 发生超时。</p><p>如果您正开着加速器，请您关闭后重试。仍然出现该问题请反馈到官方。</p><h3 id="报错-没有找到用户" tabindex="-1">报错“没有找到用户” <a class="header-anchor" href="#报错-没有找到用户" aria-label="Permalink to &quot;报错“没有找到用户”&quot;">​</a></h3><p>请检查您的配置文件是否正确，该提示表明您的配置文件中“user”字段有误，HayFrp API 没有找到对应用户。</p><h3 id="报错-连接被拒绝" tabindex="-1">报错“连接被拒绝” <a class="header-anchor" href="#报错-连接被拒绝" aria-label="Permalink to &quot;报错“连接被拒绝”&quot;">​</a></h3><ol><li><strong>防火墙或安全软件阻止</strong>：请检查您的防火墙或安全软件设置，确保允许 Frp 客户端通过。</li><li><strong>端口被占用</strong>：请检查本地端口是否被其他程序占用，可以尝试更换端口。</li><li><strong>网络问题</strong>：请检查您的网络连接是否正常，可以尝试重启路由器或联系网络管理员。</li></ol><h3 id="报错-配置文件错误" tabindex="-1">报错“配置文件错误” <a class="header-anchor" href="#报错-配置文件错误" aria-label="Permalink to &quot;报错“配置文件错误”&quot;">​</a></h3><ol><li><strong>配置文件格式错误</strong>：请检查配置文件是否按照正确的格式编写。</li><li><strong>缺少必要字段</strong>：请检查配置文件是否包含所有必要的字段，如“server_addr”、“server_port”、“token”等。</li><li><strong>字段值错误</strong>：请检查配置文件中的字段值是否正确，如端口号、IP 地址等。</li></ol><h3 id="报错-无法连接到服务器" tabindex="-1">报错“无法连接到服务器” <a class="header-anchor" href="#报错-无法连接到服务器" aria-label="Permalink to &quot;报错“无法连接到服务器”&quot;">​</a></h3><ol><li><strong>服务器宕机</strong>：请检查服务器是否正常运行，可以尝试联系管理员或等待服务器恢复。</li><li><strong>网络问题</strong>：请检查您的网络连接是否正常，可以尝试重启路由器或联系网络管理员。</li><li><strong>防火墙或安全软件阻止</strong>：请检查您的防火墙或安全软件设置，确保允许 Frp 客户端通过。</li></ol><h3 id="报错-认证失败" tabindex="-1">报错“认证失败” <a class="header-anchor" href="#报错-认证失败" aria-label="Permalink to &quot;报错“认证失败”&quot;">​</a></h3><ol><li><strong>Token 错误</strong>：请检查配置文件中的 Token 是否正确。</li><li><strong>用户名或密码错误</strong>：请检查配置文件中的用户名和密码是否正确。</li><li><strong>账户被禁用</strong>：请检查您的账户是否被禁用，可以尝试联系管理员。</li></ol><h3 id="报错-隧道已存在" tabindex="-1">报错“隧道已存在” <a class="header-anchor" href="#报错-隧道已存在" aria-label="Permalink to &quot;报错“隧道已存在”&quot;">​</a></h3><ol><li><strong>重复创建隧道</strong>：请检查是否已创建同名隧道，可以尝试更改隧道名称。</li><li><strong>配置文件错误</strong>：请检查配置文件中的隧道配置是否正确，可以尝试重新生成配置文件。</li></ol><h3 id="报错-隧道类型不支持" tabindex="-1">报错“隧道类型不支持” <a class="header-anchor" href="#报错-隧道类型不支持" aria-label="Permalink to &quot;报错“隧道类型不支持”&quot;">​</a></h3><ol><li><strong>不支持该类型隧道</strong>：请检查您选择的隧道类型是否在支持的类型列表中。</li><li><strong>配置文件错误</strong>：请检查配置文件中的隧道类型配置是否正确。</li></ol><h3 id="报错-隧道节点不可用" tabindex="-1">报错“隧道节点不可用” <a class="header-anchor" href="#报错-隧道节点不可用" aria-label="Permalink to &quot;报错“隧道节点不可用”&quot;">​</a></h3><ol><li><strong>节点负载过高</strong>：请选择其他负载较低的节点。</li><li><strong>节点维护中</strong>：请等待节点维护结束或选择其他节点。</li></ol><h3 id="报错-隧道协议不支持" tabindex="-1">报错“隧道协议不支持” <a class="header-anchor" href="#报错-隧道协议不支持" aria-label="Permalink to &quot;报错“隧道协议不支持”&quot;">​</a></h3><ol><li><strong>不支持该协议</strong>：请检查您选择的隧道协议是否在支持的协议列表中。</li><li><strong>配置文件错误</strong>：请检查配置文件中的隧道协议配置是否正确。</li></ol><h2 id="信息-start-proxy-success" tabindex="-1">信息“start proxy success.” <a class="header-anchor" href="#信息-start-proxy-success" aria-label="Permalink to &quot;信息“start proxy success.”&quot;">​</a></h2><p>这是正常的隧道启动成功提示，提示出现后意味着您的隧道已正常上线。</p><h2 id="启动成功但映射出去的网站无法访问" tabindex="-1">启动成功但映射出去的网站无法访问？ <a class="header-anchor" href="#启动成功但映射出去的网站无法访问" aria-label="Permalink to &quot;启动成功但映射出去的网站无法访问？&quot;">​</a></h2><p>多半是域名被墙了，建议使用 IP 直接访问或者开加速器访问。</p>',55),i=[t];function n(h,s,p,c,d,g){return l(),r("div",null,i)}const b=a(e,[["render",n]]);export{f as __pageData,b as default};
